import React from 'react'
import "./App.css";
import { useState } from 'react';
 function Mark() {
    const [ ta,setx]=useState('0')
    const [ en,sety]=useState('0')
    const [ ma,setm]=useState('0')
    const [ sc,sets]=useState('0')
    const [ so,seti]=useState('0')
  return (
    <>
    <center> student mark</center>
   <div id="ca">
    <div><label  id="lb2"  >:tamil <input type="number" value={ta} onChange={(e)=>setx(e.target.value)}/></label></div>
    <div></div><label  id="lb2"> :english <input type="number" value={en} onChange={(e)=>sety(e.target.value)}/></label>
    <div></div><label id="lb2">:maths <input type="number" value={ma} onChange={(e)=>sety(e.target.value)}/></label>
    <div></div><label id="lb2"> :science<input type="number" value={sc} onChange={(e)=>sety(e.target.value)}/></label>
    <div></div><label id="lb2"> :social<input type="number" value={so} onChange={(e)=>sety(e.target.value)}/></label>
    <div></div><label id="lb2"> :total mark {parseInt(ta)+parseInt(en)+parseInt(ma)+parseInt(sc)+parseInt(so)}<br></br></label>
    <label id="lb2"> :total {parseInt(ta)+parseInt(en)+parseInt(ma)+parseInt(sc)+parseInt(so)/5}<br></br></label>
    <label id="lb2"> :cut off {parseInt(ma)+parseInt(en)+parseInt(ma)+parseInt(sc)+parseInt(so)/5}<br></br></label>
    </div>
    
    
    </>
  )
}
export default Mark;
